import React from 'react'; 
//import { Nav } from 'react-bootstrap';
//import { Link } from 'react-router-dom';
 
function navbar() {
    return (
    <div className="container-fluid">
    
        <nav className ="navbar navbar-expand-md bg-dark navbar-dark">
        
        <div className="container-fluid">

            <a className="navbar-brand text-danger font-weight-bold" href="/"><h6>RETAILCLICK</h6></a>

            <button className = "navbar-toggler" type="button" data-toggler="collapse" data-target="#collapsenavbar">
                <span className="navbar-toggler-icon"></span>
            </button>

            <div className= "collapse navbar-collapse text-center" id="collapsenavbar">

                <ul className ="navbar-nav ml-auto">            
                    <li className="nav-item">
                        <a href ="/" className ="nav-link text-white"> HOME </a>
                    </li>

                    <li className="nav-item">
                        <a href ="/" className ="nav-link text-white"> ABOUT </a>
                    </li>
                    
                    <li className="nav-item">
                        <a href ="/" className ="nav-link text-white"> SERVICE </a>
                    </li>
                    
                    <li className="nav-item">
                        <a href ="/" className ="nav-link text-white"> CONTACT </a>
                    </li>

                {/* <button className="btn btn-primary navbar-btn">Ask For Demo</button> */}
                </ul>
            </div>
           
            
            </div>
        </nav>
    </div>
    );
}
export default navbar;
